import React from 'react';
import "./Shop"

export default function ShopByCategories(props) {
    const {ShopByCategory} = props;
  return (
    <div className='shopby-category'>
      {ShopByCategory.map((category)=>(
        <div key={category.shop_id} className='category-div'>
            <img src={category.shop_image} alt={category.shop_title}></img>
            <h3>{category.shop_title}</h3>
            <ul>
                {category.categories.map((list)=>(
                    <li key={category.shop_id}>{list}</li>
                ))}
            </ul>
        </div>
      ))}
    </div>
  )
}
